import React, { Component } from 'react'
import Myapp from './info';


import {BrowserRouter as Router, Switch, Route,Link} from 'react-router-dom'
import Root from './root';
class App extends Component {
    render() {
        return (
            <Router>
                <Switch>
                    <ul>
                    <li><Link to={'/'} component={Myapp}></Link></li>
                    <li><Link to={'/home'} component={Root}></Link></li>
                    </ul>
                </Switch>
            </Router>
        );
    }
}

export default App ;
